const explainText = [
    "Organize your grocery shopping experience",
    "Minimize your food waste by making the most of everything you buy",
    "Reduce your carbon footprint by opting for more sustainable meals"
];

let buttonText = [
        'Next',
        'Next',
        'Get Started']


export default function LandingPage(props){
    const [currentPage, setPage] = useState(0)
    
    function handleClick(){
        if(currentPage<2){setPage(currentPage+1)}
        else{window.location.assign('/lists');}
    }


    return (
        <div className="landing-container">
            <div className="landing">
                <div className="landing-image">{imgs[currentPage]}</div>
                <p className="landing-text"key={`text${currentPage}`}>{explainText[currentPage]}</p>
            </div>
            <Button className="landing-button" key={`button${currentPage}`}
                onClick={handleClick} 
                color={currentPage!==2?"green":null}>
                    {buttonText[currentPage]}
            </Button>
        </div>
    );
}